import React, { Component } from "react";
import "./bloodbank.css";

class BloodbankABCard extends Component {
  render() {
    return (
      <div className="card">
        <div className="card-block">
          <p className="card-title"> FFP AB Rh P(0+): {this.props.ffp_ABpos}</p>
        


        </div>

          
      </div>
    );
  }
}

export default BloodbankABCard;
